import React from "react";
import { Link } from "react-router-dom";
import logo from "../assets/logo.png";
import { Menu, MenuItem, Button } from "@material-ui/core";

const HeaderAdmon = () => {
  const [openMenu, setOpenMenu] = React.useState(null);

  const HandleMenu = () => {
    setOpenMenu(true);
  };
  const closeMenu = () => {
    setOpenMenu(false);
  };

  return (
    <div className="HomeContainer ">
      <div className="menu">
        <box-icon name="menu"></box-icon>
      </div>
      <Link to="/">
        <div className="logo">
          <img src={logo} alt="P-WorkFlow" width="200" />
        </div>
      </Link>
     

      <ul>
        <li>
          <Link to="/Proyect">Crear Proyecto</Link>
        </li>

        <li>
          <Link to="/ProyectList"> Lista de Proyectos</Link>
        </li>
        <li>
          <Link to="/CreateUser">Crear Usuarios</Link>
        </li>

        <li>
          <Link to="/UserList"> Lista de Usuarios</Link>
        </li>
        <li>
          <Link to="/Actividad"> Crear Actividad</Link>
        </li>
        <li>
          <Link to="/Proyect">Cerrar sesion</Link>
        </li>
      </ul>
    </div>
  );
};
export default HeaderAdmon;
